import React from 'react';

import { SYMBOLS, SP500, NAS100, DJ30 } from '../../assets/constants';

// function sleep(milliseconds) {
// 	const date = Date.now();
// 	let currentDate = null;
// 	do {
// 		currentDate = Date.now();
// 	} while (currentDate - date < milliseconds);
// }

function sleep(ms) {
	return new Promise(resolve => setTimeout(resolve, ms));
}

class TestFetch extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			unavailableSymbols: [],
		};
	}
	componentDidMount() {
		// SP500.slice(50, 150).forEach(symbol => {
		SP500.forEach((symbol, index) => {
			console.log('symbol', symbol);
			this.props.fetchRealTimeData([symbol], ['closePrice']).then(obj => {
				console.log('obj', obj, symbol, index);
				if (!obj) {
					this.setState(prevState => ({
						unavailableSymbols: [...prevState.unavailableSymbols, symbol],
					}));
				}
			});

			if (index % 50 === 0) {
				// console.log('waiting', index);
				// sleep(5000);

				sleep(5000).then(() => console.log('waiting', index));
			}
		});
	}

	render() {
		// console.log('props', this.props,this.props.sortConfig,'this.props.sortConfig')
		return (
			<div className=''>
				Unavailable symbols:
				<ul>
					{this.state.unavailableSymbols.map((symbol, index) => (
						<li key={index}>{symbol}</li>
					))}
				</ul>
			</div>
		);
	}
}

export default TestFetch;
